import { Media } from 'reactstrap';


class Modules extends Component{

  constructor(props){
    super(props);
    this.state={
      datas: [
        {
          id: 0,
          name:'Uthappizza',
          image: '',
          category: 'jumbotron',
          label:'Hot',
          price:'4.99',
          description:'How To Improve Focus & Concentration: Learn To Focus Better'         },
       {
          id: 1,
          name:'Zucchipakoda',
          image: 'assets/images/zucchipakoda.png',
          category: 'appetizer',
          label:'',
          price:'1.99',
          description:'Deep fried Zucchini coated with mildly spiced Chickpea flour batter accompanied with a sweet-tangy tamarind sauce'                        },
       {
          id: 2,
          name:'Vadonut',
          image: 'assets/images/vadonut.png',
          category: 'appetizer',
          label:'New',
          price:'1.99',
          description:'A quintessential ConFusion experience, is it a vada or is it a donut?'                        },
       {
          id: 3,
          name:'ElaiCheese Cake',
          image: 'assets/images/elaicheesecake.png',
          category: 'dessert',
          label:'',
          price:'2.99',
          description:'A delectable, semi-sweet New York Style Cheese Cake, with Graham cracker crust and spiced with Indian cardamoms' }
      ], 

    }
  }

 render(){
    const modules = this.state.datas.map((data) => {
      return (
        <div key={data.id} className="col-12 mt-5">
        <Media tag="li">
        <Media left middle>
          <Media object src={data.image} alt={data.name} />
         </Media>
        </Media>
        <Media body="className="ml-5 >
          <Media heading={data.name}></Media>
          <p>{data.description}</p>
        </Media>
        </div>
      );
    });

	  return(


          <div className="container">
           <div className="row">
              <Media list>
               {modules}
               </Media>
            </div>
          </div>

		);
  }
}

export default Modules;
